import React from "react";
import ContactCard from "./ContactCard";
import { connect } from "react-redux";


const ContactList = ({ ContactList }) => {
  return (
    <div>
      <h1 className="contact-list-title">Contact List</h1>
      <div>
        {ContactList.map(el => <ContactCard key={el.id} contact={el} />)}
      </div>
    </div>
  );
};

const mapStateToProps = state => {
  return {
    ContactList: state.ContactReducer
  };
};

const SmartContactList = connect(mapStateToProps)(ContactList);
export default SmartContactList;
